import axios from "axios";
import React, { useState } from "react";
import styled from "styled-components";

// import google from "./continue_google_light.png";
import google from "./continue_google_neutral.png";
// import google from "./continue_google_black.png";


import logo from "../../components/Nav/images/rock_w_logo.svg";


// Logins-로그인
function Login() {


    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");


    let body = {
        username: username,
        password: password,
    };


    //axios.post - /auth/login
    const onSubmit = async () => {
        try {
            const response = await axios.post(
                "https:/http://localhost:8080/auth/login",
                body,
                {
                    headers: { "Content-Type": "application/json" },
                }
            );
            console.log(response.data.token);

            if (response.data.token !== null) {
                localStorage.clear();
                localStorage.setItem("token", response.data.token);
                console.log("response.data.token:  " + response.data.token);

                window.location.replace("/");
            } else {
                setUsername("");
                setPassword("");
                localStorage.clear();
            }
        } catch (e) {
            alert(
                "회원 정보가 일치 하지 않습니다. 아이디와 비민번호를 다시 확인해 주세요!"
            );
            console.log(e);
        }
    };

//html
    return (
        <>
            <LoginWrap>
                <LoginContainer>
                    <LoginSigninContent>
                        <BorderAndText>
                            <LoginHeadText>로그인<br/>
                                <span>Rock 계정으로 로그인</span>
                            </LoginHeadText>
                        </BorderAndText>

                        <EmailLoginContainer>
                            <div>
                                <EmailLoginInput
                                    type="text"
                                    id="username"
                                    name="username"
                                    value={username}
                                    placeholder="아이디"
                                    required
                                    onChange={(e) => {
                                        setUsername(e.target.value);
                                    }}
                                />
                                <EmailLoginInput
                                    type="text"
                                    id="password"
                                    name="password"
                                    value={password}
                                    placeholder="비밀번호"
                                    required
                                    onChange={(e) => {
                                        setPassword(e.target.value);
                                    }}
                                />
                            </div>

                            <EmailLoginOption>
                                <div className="inputCheckbox">
                                    <input type="checkbox" id="id-save" className="input-id-save"
                                           required
                                           onChange={(e) =>{
                                               setUsername(e.target.checked.value)
                                           }}
                                    />
                                    <label for="id-save" className="label-id-save">아이디 저장</label>

                                    {/*<InputCheckbox>*/}
                                    {/*    <Bp type="checkbox" id="id-save"></Bp>*/}
                                    {/*</InputCheckbox>*/}
                                    {/*<label htmlFor="id-save">아이디 저장</label>*/}

                                </div>
                                <a href="/findIdPassword">아이디 찾기&nbsp;&nbsp;|&nbsp;&nbsp;비밀번호 찾기</a>
                            </EmailLoginOption>


                            {/*로그인 버튼*/}
                            <CommonButton
                                type="button"
                                onClick={() => {
                                    onSubmit();
                                    console.log("body: " + username + ", " + password);
                                }}
                            >
                                <a>로그인</a>
                            </CommonButton>


                            {/*회원가입 버튼*/}
                            <SignupButton
                                type="button"
                                onClick={() => {
                                    onSubmit();
                                    console.log("body: " + username + ", " + password);
                                }}
                            >
                                <a href="/SignUp">회원가입</a>
                            </SignupButton>


                            {/*구글 버튼*/}
                            <LoginSignupContent>
                            <LogoImg
                                alt="logo"
                                src={google}
                                onClick={() => {
                                    // 사용하려면 App.js에서 /로 라우팅해야 한다
                                    window.location.replace("/users/login");
                                }}
                            >
                            </LogoImg>
                                </LoginSignupContent>
                        </EmailLoginContainer>
                    </LoginSigninContent>
                </LoginContainer>
            </LoginWrap>
        </>
    );
}


//로그인 버튼
const CommonButton = styled.button`
    display: block;
    height: 48px;
    border-radius: 30px;
    font-size: 18px;
    color: #fff;
    background: #1351f9;
    border-radius: 5px;
    width: 100%;
    margin-left: 0;
    margin-top: 5px;
    margin-bottom: 20px;
    border: none;
    box-sizing: border-box;
    transition: border-color 0.2s cubic-bezier(0.075, 0.82, 0.165, 1);
  a{
      cursor: pointer;
      text-align: center;
      text-decoration: none;
      vertical-align: middle;
      color: #ffffff;
      line-height: 20px;
      font-size: 18px;
      font-weight: 500;
      font-family: 'SUIT-Regular' !important;
      display: flex;
      justify-content: center;
  }
`;
// 회원가입 버튼
const SignupButton = styled.button`
    display: block;
    height: 48px;
    border-radius: 30px;
    font-size: 18px;
    color: #fff;
    background: rgba(0, 0, 0, 0.1);
    border: 1px solid #fff;
    border-radius: 5px;
    width: 100%;
    margin-left: 0;
    margin-top: 5px;
    margin-bottom: 20px;
    box-sizing: border-box;
    transition: border-color 0.2s cubic-bezier(0.075, 0.82, 0.165, 1);
  a{
      cursor: pointer;
      text-align: center;
      text-decoration: none;
      vertical-align: middle;
      color: #ffffff;
      line-height: 20px;
      font-size: 18px;
      font-weight: 500;
      font-family: 'SUIT-Regular' !important;
      display: flex;
      justify-content: center;
